exports.add=(req, res, next)=>{
    let id = req.body.id;
    let name = req.body.username;
    let pass = req.body.passwd;
    let email = req.body.email;
    let image = req.body.image;
    let phone = req.body.phone;
    let obj ={
        id:id,
        username:name,
        password:pass,
        email:email,
        phone:phone,
        image:image
    }
    listUser.push(obj);
    res.render('user/users',{ users:listUser, title: "Users"})
}
exports.put=(req, res, next)=>{
    let id = req.body.idUpdate;
    let name = req.body.usernameUpdate;
    let pass = req.body.passwdUpdate;
    let email = req.body.emailUpdate;
    let image = req.body.imageUpdate;
    let phone = req.body.phoneUpdate;
    for(let i=0;i<listUser.length;i++){
        if(id==listUser[i].id){
            let obj ={
                id:id,
                username:name,
                password:pass,
                email:email,
                phone:phone,
                image:image
            }
            listUser[i]=obj;
            return res.render('user/users',{ users:listUser, title: "Users"})
        }
    }
}
exports.delete=(req, res, next)=>{
    let id ;
    for(let i=0;i<listUser.length;i++){
        if(id==listUser[i].id){
            listUser.splice(i,1)
            return res.render('user/users',{ users:listUser, title: "Users"})
        }
    }
}
